import React, { useState } from "react";
import {
  TableContainer,
  Table,
  TableHead,
  TableBody,
  TableRow,
  TableCell,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { mergeClasses } from "@material-ui/styles";
const useStyles = makeStyles((theme) => ({
  tablaMaterial: {
    minWidth:700,
    color: "#fff",
  },
}));

function Prueba() {
  /*const baseUrl = "http://localhost:4000/createUser";
  const [data, setData] = useState([]);

  const peticionesGet = async () => {
    await axios
      .get(baseUrl)
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };
*/

  var data = [
    { id: 1, name: "Gob", value: "2" },
    { id: 2, name: "Buster", value: "5" },
    { id: 3, name: "George Michael", value: "4" },
  ];
  return (
    <div class="App">
      <h3 class="LabelTitleComponent">Lista deProyectos </h3>
      <TableContainer>
        <Table className={u.tablaMaterial}>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>NAME</TableCell>
              <TableCell align="right">VALOR</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.map((celda) => (
              <TableRow>
                <TableCell>{celda.id}</TableCell>
                <TableCell>{celda.name}</TableCell>
                <TableCell>{celda.value}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}
export default Prueba;
